rare &quot;an exceeda production&quot; made music video. &quot;Outsiders&quot; is a song from  You Could Have It So Much Better, the second studio album by Glaswegian indie rock band Franz Ferdinand that was first released 3 October 2005 in the United Kingdom. Recorded in both the United States and their own studio in Glasgow with producer Rich Costey, the album gave birth to the release of four UK Top 30 singles including this song. The album became the band's first UK #1 album and although their debut album was relatively successful in the USA, going platinum and reaching #32, You Could Have It So Much Better managed to reach #8 and earned gold status in the States.

This music video was made using clips from the cult classic movie &quot;Carnival of Souls&quot; starring Candace Hilligoss.

