Franz Ferdinand are an indie rock band formed in 2002, and based in Glasgow, Scotland. The band is composed of Alex Kapranos (lead vocals and guitar), Bob Hardy (bass guitar), Nick McCarthy (rhythm guitar, keyboards and backing vocals), and Paul Thomson (drums, percussion and backing vocals). The band first experienced chart success when their second single, &quot;Take Me Out&quot;, reached No. 3 in the UK Charts, followed by their debut album, Franz Ferdinand, which debuted on the UK album chart at No. 3. The band went on to win the 2004 Mercury Music Prize, and two BRIT Awards in 2005 for Best British Group and Best British Rock Act. NME named Franz Ferdinand as their Album of the Year. From the album, three top-ten singles were released: &quot;Take Me Out&quot;, &quot;The Dark of the MatinÃƒÂ©e&quot;, and &quot;This Fire&quot;.

They were part of the mid-2000s post-punk revival along with Arctic Monkeys and Kaiser Chiefs.

On 16 May 2013, Franz Ferdinand officially announced their fourth album, titled Right Thoughts, Right Words, Right Action, along with cover art, track listing, which was released on August 26, 2013.
